import Link from 'next/link';

const linkStyle = {
    display: "flex",
    marginRight: 20,
    justifycontent: "spaced-between"
}

const Header = () => (
    <div>

        <Link href='/'>
            <a style={linkStyle}>Home</a>
        </Link>

        <Link href="/about">
            <a style={linkStyle}>About</a>
        </Link>

    </div>
);

export default Header;
